import React, { useState, useEffect} from 'react';
import Avatar from '@material-ui/core/Avatar';
import Button from '@material-ui/core/Button';
import CssBaseline from '@material-ui/core/CssBaseline';
import TextField from '@material-ui/core/TextField';
import Link from '@material-ui/core/Link';
import Box from '@material-ui/core/Box';
import LockOutlinedIcon from '@material-ui/icons/LockOutlined';
import Typography from '@material-ui/core/Typography';
import { makeStyles } from '@material-ui/core/styles';
import Container from '@material-ui/core/Container';
import { green } from '@material-ui/core/colors';
import { blue } from '@material-ui/core/colors';
import { useForm } from "react-hook-form";
import { IconContext } from 'react-icons';
import axios from 'axios'


/* 
function Copyright() {
  return (
    <Typography variant="body2" color="textSecondary" align="center">
      {'Copyright Â© '}
      <Link color="inherit" href="/">
        Kataleya
      </Link>{' '}
      {new Date().getFullYear()}
      {'.'}
    </Typography>
  );
} */


const useStyles = makeStyles((theme) => ({
  paper: {
  /*   paddingTop : theme.spacing(10), */
    display: 'flex',
    flexDirection: 'column',
    alignItems: 'center',

  },
  avatar: {
    margin: theme.spacing(1),
    backgroundColor: theme.palette.success.main,
  },
  form: {
    width: '100%', // Fix IE 11 issue.
    marginTop: theme.spacing(1),
  },
  submit: {
    margin: theme.spacing(3, 0, 2),
    color: theme.palette.getContrastText(green[500]),
    backgroundColor: blue['#94aabe'],
    '&:hover': {
      backgroundColor: blue['#003366'],
    },
    backdrop: {
      zIndex: theme.zIndex.drawer + 1,
      color: 'green',
    },

  },
}));

function FakeForm(props) {

  const classes = useStyles();
  const [display, setdisplay] = useState("none")
  const { register , handleSubmit, errors } = useForm();
  const [message, setmessage] = useState("")


  const Auth = async (data) => {

     axios.post('http://localhost:8000/api/messages',
    {
      name: data.name,
      title: data.title,
      email: data.email,
      content: data.content

    })
    .then(res => {
      setmessage("Message sent successfully! :) ");
      setdisplay('inline');
      window.location.replace("/");
    })
  .catch((error) => {
    if(error.response){
      setmessage("N e t w o r k  E r r o r")
      setdisplay('inline');
    }
  })
}

  return (
        <IconContext.Provider value={{ color: '#B5DFBB' }}>

      <div className='main-color' >
    <Container component="main" maxWidth="xs">

      <div className={classes.paper}>
      <Typography component="h1" variant="h5">
          send Us a Message
        </Typography>
        {errors.exampleRequired && <span>This field is lalaa</span>}
        {<span style={{display: display, color: 'red' }}>{message}</span>}
        <form onSubmit={handleSubmit((data) => Auth(data))} className={classes.form}>

           <TextField
            variant="outlined"
            margin="normal"
            required
            fullWidth
            id="name"
            label="Your Name"
            type="name"
            name="name"
            inputRef={register}
          />
           <TextField
            variant="outlined"
            margin="normal"
            required
            fullWidth
            id="email"
            label="Email Address"
            type="email"
            name="email"
            inputRef={register}
          />
          <TextField
            variant="outlined"
            margin="normal"
            required
            fullWidth
            id="title"
            label="Subject"
            type="title"
            name="title"
            autoComplete="title"
            inputRef={register}
          />
          <TextField
            variant="outlined"
            margin="normal"
            required
            fullWidth
            name="content"
            label="Your Message"
            type="content"
            id="content"
            autoComplete="content"
            inputRef={register}
          />

          <Button
            type="submit"
            fullWidth
            variant="contained"
            color="primary"
            className={classes.submit} >
            Send
          </Button>
        </form>
      </div>
      <Box mt={8}>
       {/*  <Copyright /> */}
      </Box>
    </Container>
    </div>
    </IconContext.Provider>
  );
  }



export default FakeForm;
